import { bootstrapApplication } from "@angular/platform-browser";
import { provideRouter } from "@angular/router";
import { AppComponent } from "./app/app.component";
import { AcademyComponent } from "./app/pages/academy/academy";

const routes = [
  { path: "", redirectTo: "/academy", pathMatch: "full" },
  { path: "academy", component: AcademyComponent },
  { path: "home", component: AcademyComponent },
  { path: "quotes", component: AcademyComponent },
  { path: "wealth", component: AcademyComponent },
  { path: "portfolio", component: AcademyComponent },
  { path: "profile", component: AcademyComponent },
];

bootstrapApplication(AppComponent, {
  providers: [provideRouter(routes)],
}).catch((err) => console.error(err));
